import React, { Component } from "react";
import "./App.css";
import { Route, Switch, withRouter, Link } from "react-router-dom";
import Airtable from "airtable";
import Employees from "./Employees";
import Conferences from "./Conferences";
import ConferenceData from "./ConferenceData";
import Tabs from "./Tabs";
import SideBar from "./SideBar";
import Details from "./Details";

const base = new Airtable({ apiKey: "keyHHrGcNLiewGh05" }).base(
  "appnnQqeeXZmvVJvB"
);

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { goals: [] };
  }
  handleBack = () => {
    this.props.history.push("/");
  };
  render() {
    return (
      <>
        <nav className="navbar navbar-dark bg-dark">
          <Link className="home-link" onClick={this.handleBack}>
            Home
          </Link>
        </nav>
        <div className="wrapper">
          <SideBar />
          <Switch>
            <Route exact path="/employees" render={() => <Employees />} />
            <Route exact path="/conferences" render={() => <Conferences />} />
            <Route
              exact
              path="/employee/:name"
              render={(props) => <Tabs name={props} />}
            />
            <Route
              exact
              path="/employee/:name/details/:meeting"
              render={(props) => <Details name={props} />}
            />
            <Route
              exact
              path="/conference/:id"
              render={(props) => <ConferenceData name={props} />}
            />
          </Switch>
        </div>
      </>
    );
  }
}

export default withRouter(App);
